import React from 'react'
import './Admintimetable.css';

export default function AdminTimetable() {
  return (
    <div style={{marginLeft:window.innerWidth < 768 ? "2.5rem" : "2.5rem",textAlign: "center"}}>
      <select style={{width: "97%", padding: "10px", fontSize: "16px",backgroundColor: "#ffffff", border: "1px solid #ccc", borderRadius: "4px"}}>
        <option value="">Select Timetable</option>
        <option value="course1">First year</option>
        <option value="course2">Second year</option>
        <option value="course3">Third year</option>
      </select>
    </div>
  )
}
